  "left_context": "– Si vous êtes sages, bien entendu ! Ne faites pas tourner Nelly en bourrique, elle a besoin de calme aujourd'hui, car elle n'a pas très bien dormi.\\n     Il adressa un nouveau clin d'oeil à la nounou et se leva.\\n     – Je vous laisse, le devoir m'appelle. À ce soir !\\n     Il gagna ses appartements et passa un costume trois pièces taillé à ses mesures dans une étoffe filée par les mains expertes d'une Tisseuse, comme il en subsistait encore quelques-unes dans les ateliers des vieux quartiers. Les Tisseuses produisaient elles-mêmes le fil soyeux et résistant utilisé pour les confections de prestige, ce qui leur valait le peu affectueux surnom d'araignées. Aucun humain n'aurait accepté de porter un vêtement issu de leur métier, à supposer qu'il eût les moyens de se l'offrir. Voilà bien une preuve supplémentaire du dédain qu'ils affichaient pour les authentiques pionniers du nouveau monde, ne put s'empêcher de songer le Pâle tandis qu'il resserrait le noeud de sa cravate. Satisfait de l'image renvoyée par sa psyché, il rejoignit le vestibule et sortit.\\n     ",
  "right_context": "À croire que son cocher avait passé la nuit dehors, le cul collé au siège de l'attelage. Kaspar se présentait en réalité chaque matin à la même heure devant la demeure du Gouverneur, et patientait le temps qu'il fallait en fumant la pipe et lisant Le Vigilant . Ce qu'il faisait encore ce matin-là.\\n     – Hé bien Kaspar, l'interpella le Pâle en dévalant les marches du perron, sur qui êtes-vous prêt à parier votre liquette ? Durdenne ou Le Camelot ?\\n     Le cocher tapota le culot de sa bouffarde contre le flanc de la voiture, descendit pour ouvrir la portière au Gouverneur et répondit :       – Bonjour, monsieur. Je pensais que vous me donneriez un tuyau, à vrai dire...\\n     – Le meilleur qu'on puisse donner à un vieux camarade : gardez donc votre argent pour les frais du ménage et évitez les boutiques des bookmakers pendant la Rencontre.\\n     Le Pâle s'installa dans l'habitacle de la confortable carriole capitonnée, dont les essieux grincèrent. ",
  "sentence": "Sa voiture l'attendait sur le parvis, à l'endroit exact où elle l'avait déposé la veille au soir. ",
